import React from 'react';
import ReactDOM from 'react-dom/client';


import { App } from './App';


const root = ReactDOM.createRoot(
    document.getElementById('root') as HTMLElement
);
console.log(document.getElementById('root'));

root.render(
   <React.StrictMode>
    <App />
   </React.StrictMode>
)
